import time
from typing import List

class Solution:
    def oddEvenJumps(self, A: List[int]) -> int:
        N = len(A)
        def precalc_next_jumps(l):
            res = [None] * N
            stack = []
            for i in l:
                while stack and i > stack[-1]:
                    res[stack.pop()] = i
                stack.append(i)
            return res
        
        oddnext = precalc_next_jumps(sorted(range(N), key=lambda x: A[x]))
        evennext = precalc_next_jumps(sorted(range(N), key=lambda x: -A[x]))

        odd = [False] * N
        even = [False] * N
        odd[N-1] = even[N-1] = True

        for i in range(N-2, -1, -1):
            if (oddnext[i] != None):
                odd[i] = even[oddnext[i]]
            if (evennext[i] != None):
                even[i] = odd[evennext[i]]
        
        return sum(odd)

def test(input, expected):
    start = time.time_ns()
    try:
        solution = Solution()
        actual = solution.oddEvenJumps(input)
        if actual != expected:
            raise ValueError(f"actual value '{actual}' is not equal to expected value '{expected}'")
    finally:
        elapsed = (time.time_ns() - start) / (10 ** 9)
        print(f"elapsed: {elapsed} secs")

